A misanthropic teenage girl plays a very cruel and bloody game with a young boy who admires her in this extraordinary film from Rue Morgue Magazine founder Rodrigo Gudino. Brave, provocative, blackly comic and deeply perverse, this smartly-scripted short easily ranks, to some, among the best seen from Canada in years.


